import React from "react";
import "../styles.css";
import { Link } from "react-router-dom";

function Registration() {
  return (
    <div
      style={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        height: "100vh",
        margin: "-24px",
      }}
    >
      <div
        style={{
          backgroundColor: "#1200b8",
          padding: "20px",
          color: "white",
          width: "300px",
        }}
      >
        <h1
          style={{ color: "#004cff", fontSize: "100px", margin: 0, padding: 0 }}
        >
          인뱅
        </h1>
        <h2 style={{ color: "#004cff" }}>In-Bang</h2>
        <Link
          to="/"
          style={{
            position: "absolute",
            right: "10px",
            top: "10px",
            textDecoration: "none",
          }}
        >
          <button
            style={{
              backgroundColor: "#fc2003",
              color: "#000000",
              padding: "5px",
            }}
          >
            X
          </button>
        </Link>
        <p
          style={{
            color: "#000000",
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
          }}
        >
          Registration!
        </p>
        <div
          style={{
            display: "flex",
            flexDirection: "column",
            marginBottom: "10px",
          }}
        >
          <label>Full Name:</label>
          <input type="text" name="full_name" style={{ width: "100%" }} />
        </div>
        <div
          style={{
            display: "flex",
            flexDirection: "column",
            marginBottom: "10px",
          }}
        >
          <label>Username:</label>
          <input type="text" name="username" style={{ width: "100%" }} />
        </div>
        <div
          style={{
            display: "flex",
            flexDirection: "column",
            marginBottom: "10px",
          }}
        >
          <label>Email:</label>
          <input type="email" name="email" style={{ width: "100%" }} />
        </div>
        <div
          style={{
            display: "flex",
            flexDirection: "column",
            marginBottom: "10px",
          }}
        >
          <label>Phone Number:</label>
          <input type="tel" name="phone_number" style={{ width: "100%" }} />
        </div>
        <div
          style={{
            display: "flex",
            flexDirection: "column",
            marginBottom: "10px",
          }}
        >
          <label>Password:</label>
          <input type="password" name="password" style={{ width: "100%" }} />
        </div>
        <div
          style={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            marginTop: "20px",
          }}
        >
          <Link to="/login">
            <button
              style={{
                backgroundColor: "#000000",
                color: "#ffffff",
                padding: "5px",
              }}
            >
              Register
            </button>
          </Link>
        </div>
      </div>
    </div>
  );
}

export default Registration;
